import React from "react";

import dummySool from "../static/dummyData";
import SoolCard from "./SoolCard";

const SoolList = () => {
    return (
        <ul>
            {dummySool.map((sool) => <div key={sool.id}>{sool.name}</div>)}
        </ul>
    )
}

export default SoolList
